list(`package:mlr3` = function (task, learners, resampling, iterations, predictions, learner_states = NULL, store_backends = TRUE) 
{
  assert_integer(iterations, any.missing = FALSE, lower = 1, upper = resampling$iters, unique = TRUE)
  assert_task(task)
  assert_learners(learners, task = task)
  assert_resampling(resampling, instantiated = TRUE)
  predictions = lapply(predictions, as_prediction_data)
  uhash = UUIDgenerate()
  if (is.null(learner_states)) {
    learner_states = map(learners, "state")
  }
  ResultData$new(data.table(task = list(task), learner = learners, learner_state = learner_states, resampling = list(resampling), iteration = iterations, prediction = predictions, uhash = uhash), store_backends = store_backends)
}, function (task, learners, resampling, iterations, predictions, learner_states = NULL, store_backends = TRUE) 
{
  assert_integer(iterations, any.missing = FALSE, lower = 1, upper = resampling$iters, unique = TRUE)
  assert_task(task)
  assert_learners(learners, task = task)
  assert_resampling(resampling, instantiated = TRUE)
  predictions = lapply(predictions, as_prediction_data)
  uhash = UUIDgenerate()
  if (is.null(learner_states)) {
