  res = future_map(n, workhorse, iteration = seq_len(n), learner = grid$learner, mode = grid$mode, MoreArgs = list(task = task, resampling = resampling, store_models = store_models, lgr_threshold = lgr_threshold, pb = pb))
  data = data.table(task = list(task), learner = grid$learner, learner_state = map(res, "learner_state"), resampling = list(resampling), iteration = seq_len(n), prediction = map(res, "prediction"), uhash = UUIDgenerate())
