list(`package:multicolor` = function (txt = "hello world!", colors = NULL, recycle_chars = FALSE, direction = "vertical", pause = 0.05, ...) 
{
  if (!is.character(txt) || length(txt) != 1) {
    stop("txt must be a character vector of length 1.")
  }
  if (!is.numeric(pause) || pause < 0) 
    stop("pause must be a number > 0.")
  if (is.null(colors)) 
    colors <- viridisLite::plasma(stringr::str_length(txt), direction = -1, begin = 0.3)
  if (use_color() == FALSE) {
    message("Colors cannot be applied in this environment. Please use another application, such as RStudio or a color-enabled terminal.")
    for (i in seq(nchar(txt))) {
      cat(substr(txt, i, i))
      Sys.sleep(pause)
    }
  }
  else {
    vec <- multi_color(txt, colors = colors, direction = direction, recycle_chars = recycle_chars, type = "crawl", ...)
    for (i in seq_along(vec)) {
      cat(vec[i])
      Sys.sleep(pause)
    }
  }
}, function (txt = "hello world!", colors = NULL, recycle_chars = FALSE, direction = "vertical", pause = 0.05, ...) 
{
  if (!is.character(txt) || length(txt) != 1) {
