list(`package:multicolor` = function (s) 
{
  newline_ix <- s %>% stringr::str_locate("\n") %>% purrr::as_vector() %>% dplyr::first()
  if (is.na(newline_ix)) {
    return(s)
  }
  s_first <- substr(s, 1, newline_ix)
  s_nixed <- s_first %>% nix_newline()
  out <- stringr::str_c(s_nixed, substr(s, newline_ix + 1, nchar(s)))
  return(out)
