list(`package:multicolor` = function (string, maxlen = 1, step = 1, display = FALSE) 
{
  if (maxlen == 0) {
    return("\n")
  }
  if (stringr::str_length(string) <= maxlen) {
    return(string)
  }
  output <- rev(stringr::str_c(stringr::str_sub(string, 1, maxlen), "\n", triangle_string(stringr::str_sub(string, maxlen + 1, stringr::str_length(string)), maxlen = maxlen + step, step = step)))
  ifelse(display, return(output), return(invisible(output)))
}, function (string, maxlen = 1, step = 1, display = FALSE) 
{
  if (maxlen == 0) {
    return("\n")
  }
  if (stringr::str_length(string) <= maxlen) {
    return(string)
  }
  output <- rev(stringr::str_c(stringr::str_sub(string, 1, maxlen), "\n", triangle_string(stringr::str_sub(string, maxlen + 1, stringr::str_length(string)), maxlen = maxlen + step, step = step)))
  ifelse(display, return(output), return(invisible(output)))
})
