list(`package:nlme` = function (x, form = resid(., type = "pearson") ~ fitted(.), abline, id = NULL, idLabels = NULL, idResType = c("pearson", "normalized"), grid, ...) 
{
  object <- x
  if (!inherits(form, "formula")) {
    stop("'form' must be a formula")
  }
  allV <- all.vars(asOneFormula(form, id, idLabels))
  allV <- allV[is.na(match(allV, c("T", "F", "TRUE", "FALSE")))]
  if (length(allV) > 0) {
    data <- getData(object)
    if (is.null(data)) {
      alist <- lapply(as.list(allV), as.name)
      names(alist) <- allV
      alist <- c(list(quote(data.frame)), alist)
      mode(alist) <- "call"
      data <- eval(alist, sys.parent(1))
    }
    else {
      if (any(naV <- is.na(match(allV, names(data))))) {
        stop(sprintf(ngettext(sum(naV), "%s not found in data", "%s not found in data"), allV[naV]), domain = NA)
      }
    }
  }
  else data <- NULL
  if (inherits(data, "groupedData")) {
    ff <- formula(data)
    rF <- deparse(getResponseFormula(ff)[[2]])
    cF <- c_deparse(getCovariateFormula(ff)[[2]])
    lbs <- attr(data, "labels")
    unts <- attr(data, "units")
    if (!is.null(lbs$x)) 
      cL <- paste(lbs$x, unts$x)
    else cF <- NULL
    if (!is.null(lbs$y)) 
      rL <- paste(lbs$y, unts$y)
    else rF <- NULL
  }
  else {
    rF <- cF <- NULL
  }
  dots <- list(...)
  args <- if (length(dots) > 0) 
    dots
  else list()
  data <- as.list(c(as.list(data), . = list(object)))
  covF <- getCovariateFormula(form)
  .x <- eval(covF[[2]], data)
  if (!is.numeric(.x)) {
    stop("covariate must be numeric")
  }
  argForm <- ~.x
  argData <- data.frame(.x = .x, check.names = FALSE)
  if (is.null(xlab <- attr(.x, "label"))) {
    xlab <- deparse(covF[[2]])
    if (!is.null(cF) && (xlab == cF)) 
      xlab <- cL
    else if (!is.null(rF) && (xlab == rF)) 
      xlab <- rL
  }
  if (is.null(args$xlab)) 
    args$xlab <- xlab
  respF <- getResponseFormula(form)
  if (!is.null(respF)) {
    .y <- eval(respF[[2]], data)
    if (is.null(ylab <- attr(.y, "label"))) {
      ylab <- deparse(respF[[2]])
      if (!is.null(cF) && (ylab == cF)) 
        ylab <- cL
      else if (!is.null(rF) && (ylab == rF)) 
        ylab <- rL
    }
    argForm <- .y ~ .x
    argData[, ".y"] <- .y
    if (is.null(args$ylab)) 
      args$ylab <- ylab
  }
  grpsF <- getGroupsFormula(form)
  if (!is.null(grpsF)) {
    gr <- splitFormula(grpsF, sep = "*")
    for (i in seq_along(gr)) {
      auxGr <- all.vars(gr[[i]])
      for (j in auxGr) {
        argData[[j]] <- eval(as.name(j), data)
      }
    }
    if (length(argForm) == 2) 
      argForm <- eval(parse(text = paste("~ .x |", deparse(grpsF[[2]]))))
    else argForm <- eval(parse(text = paste(".y ~ .x |", deparse(grpsF[[2]]))))
  }
  args <- c(list(argForm, data = argData), args)
  if (is.null(args$cex)) 
    args$cex <- par("cex")
  if (is.null(args$adj)) 
    args$adj <- par("adj")
  if (!is.null(id)) {
    idResType <- match.arg(idResType)
    id <- switch(mode(id), numeric = {
      if ((id <= 0) || (id >= 1)) {
        stop("'id' must be between 0 and 1")
      }
      as.logical(abs(resid(object, type = idResType)) > -qnorm(id/2))
    }, call = eval(asOneSidedFormula(id)[[2]], data), stop("'id' can only be a formula or numeric"))
    if (is.null(idLabels)) {
      idLabels <- getGroups(object)
      if (length(idLabels) == 0) 
        idLabels <- 1:object$dims$N
      idLabels <- as.character(idLabels)
    }
    else {
      if (mode(idLabels) == "call") {
        idLabels <- as.character(eval(asOneSidedFormula(idLabels)[[2]], data))
      }
      else if (is.vector(idLabels)) {
        if (length(idLabels <- unlist(idLabels)) != length(id)) {
          stop("'idLabels' of incorrect length")
        }
        idLabels <- as.character(idLabels)
      }
      else {
        stop("'idLabels' can only be a formula or a vector")
      }
    }
  }
  if (missing(abline)) {
    if (missing(form)) {
      abline <- c(0, 0)
    }
    else {
      abline <- NULL
    }
  }
  assign("abl", abline)
  if (length(argForm) == 3) {
    if (is.numeric(.y)) {
      plotFun <- "xyplot"
      if (is.null(args$panel)) {
        args <- c(args, panel = list(function(x, y, subscripts, ...) {
          x <- as.numeric(x)
          y <- as.numeric(y)
          dots <- list(...)
          if (grid) panel.grid()
          panel.xyplot(x, y, ...)
          if (any(ids <- id[subscripts])) {
            ltext(x[ids], y[ids], idLabels[subscripts][ids], cex = dots$cex, adj = dots$adj)
          }
          if (!is.null(abl)) {
            if (length(abl) == 2) panel.abline(a = abl, ...) else panel.abline(h = abl, ...)
          }
        }))
      }
    }
    else {
      plotFun <- "bwplot"
      if (is.null(args$panel)) {
        args <- c(args, panel = list(function(x, y, ...) {
          if (grid) panel.grid()
          panel.bwplot(x, y, ...)
          if (!is.null(abl)) {
            panel.abline(v = abl[1], ...)
          }
        }))
      }
    }
  }
  else {
    plotFun <- "histogram"
    if (is.null(args$panel)) {
      args <- c(args, panel = list(function(x, ...) {
        if (grid) panel.grid()
        panel.histogram(x, ...)
        if (!is.null(abl)) {
          panel.abline(v = abl[1], ...)
        }
      }))
    }
  }
  if (missing(grid)) 
    grid <- (plotFun == "xyplot")
  do.call(plotFun, as.list(args))
}, function (x, form = resid(., type = "pearson") ~ fitted(.), abline, id = NULL, idLabels = NULL, idResType = c("pearson", "normalized"), grid, ...) 
{
  object <- x
  if (!inherits(form, "formula")) {
    stop("'form' must be a formula")
  }
  allV <- all.vars(asOneFormula(form, id, idLabels))
  allV <- allV[is.na(match(allV, c("T", "F", "TRUE", "FALSE")))]
  if (length(allV) > 0) {
    data <- getData(object)
    if (is.null(data)) {
      alist <- lapply(as.list(allV), as.name)
      names(alist) <- allV
      alist <- c(list(quote(data.frame)), alist)
      mode(alist) <- "call"
