list(`package:openxlsx` = function (wb, sheet, file, width = 6, height = 3, startRow = 1, startCol = 1, units = "in", dpi = 300) 
{
  op <- get_set_options()
  on.exit(options(op), add = TRUE)
  if (!file.exists(file)) {
    stop("File does not exist.")
  }
  if (!grepl("\\\\|\\/", file)) {
    file <- file.path(getwd(), file, fsep = .Platform$file.sep)
  }
  units <- tolower(units)
  if (!units %in% c("cm", "in", "px")) {
    stop("Invalid units.\nunits must be one of: cm, in, px")
  }
  startCol <- convertFromExcelRef(startCol)
  startRow <- as.integer(startRow)
  if (units == "px") {
    width <- width/dpi
    height <- height/dpi
  }
  else if (units == "cm") {
    width <- width/2.54
    height <- height/2.54
  }
  widthEMU <- as.integer(round(width * 914400, 0))
  heightEMU <- as.integer(round(height * 914400, 0))
  wb$insertImage(sheet, file = file, startRow = startRow, startCol = startCol, width = widthEMU, height = heightEMU)
