}, function (word, maxCodeLen = 4, clean = TRUE) 
{
  word <- gsub("|", "A", word, perl = TRUE)
  word <- gsub("|||", "E", word, perl = TRUE)
  word <- gsub("|", "I", word, perl = TRUE)
  word <- gsub("", "O", word, perl = TRUE)
  word <- gsub("||", "U", word, perl = TRUE)
  word <- gsub("", "Y", word, perl = TRUE)
  word <- gsub("", "C", word, perl = TRUE)
  word <- toupper(word)
  word[is.null(word)] <- NA
  listNAs <- is.na(word)
  if (any(nonalpha <- grepl("[^A-Z]", word, perl = TRUE)) && clean) 
    warning("unknown characters found, results may not be consistent")
  word <- gsub("[^A-Z]*", "", word, perl = TRUE)
  first <- substr(word, 1, 1)
  word <- substr(word, 2, nchar(word))
  word <- gsub("A|E|I|O|U|Y", "", word, perl = TRUE)
  word <- paste(first, word, sep = "")
  word <- gsub("([A-Z])\\1+", "\\1", word, perl = TRUE)
  word <- substr(word, 1, maxCodeLen)
  word[listNAs] <- NA
  if (clean) 
    word[nonalpha] <- NA
  return(word)
})
c("package:phonics", "namespace:phonics")
c(TRUE, FALSE)
c(FALSE, TRUE)
